import React from 'react';
import { Box, Typography } from '@material-ui/core';

const SkillsData = [{
    barTitle: "HTML",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "CSS",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "JavaScript",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "JQuery",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "Bootstrap",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "HTML",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}, {
    barTitle: "HTML",
    barClassName: "progress-bar progress-bar-striped progress-bar-animated",
    barWidth: "100%"
}]

const Skills = () => {
    return (<>
        {SkillsData.map((item, index) => { return (<Box><Typography>{item.barTitle}</Typography></Box>) })}
    </>)
}

export default Skills
